setup('posts/1');
const othersPosts = _data.posts.filter(post => post.userId !== 1);
othersPosts.forEach(post => {
  cy.get('h1').should('not.contain', post.title);
});
const userPosts = _data.posts.filter(post => post.userId === 1);
userPosts.forEach(post => {
  cy.contains(post.title);
});

_data.users.forEach(user => {
  setup(`posts/${user.id}`);
  const userPosts = _data.posts.filter(post => post.userId === user.id);
  userPosts.forEach(post => {
    cy.contains(post.title);
  });
});
